import React from 'react';

const StudentDashboard = () => {
  return (
    <div style={styles.container}>
      <h1>Student Dashboard</h1>
      <p>Manage your bookings and learnings here.</p>
    </div>
  );
};

const styles = {
  container: {
    padding: '20px',
    textAlign: 'center',
  },
};

export default StudentDashboard;
